#include <iostream>
#include <string>
#include <map>
using namespace std;
using namespace std::chrono;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
    	int longest = 0, previous = 0, current = 0;
    	int charMap[256];
    	for(int i = 0; i < 256; i++) {
    		charMap[i] = -1;
    	}
    	for(string::size_type i = 0; i < s.size(); i++) {
    		if(charMap[s[i]] >= previous) {
    			previous = charMap[s[i]] + 1;
    		}
    		charMap[s[i]] = i;
    		current = i - previous + 1;
    		if(current > longest) {
    			longest = current;
    		}
    	}
        return longest;
    }
};

